import React from 'react'
import { withRouter, Link } from 'react-router-dom'
function Home() {
  return (
    <div className="home">
      <h1>YEAH LET'S PLAY SOME D&D</h1>
      <h3><Link to="/classes" path="/" exact>Let's find you a class to play!</Link></h3>

    </div>
  )
}

export default withRouter(Home)
